<style>
*{box-sizing:border-box}

body{
margin:0;
font-family:Segoe UI, Arial, sans-serif;
background:linear-gradient(135deg,#0a3d62,#1e90ff);
min-height:100vh;
display:flex;
flex-direction:column;
align-items:center;
color:#fff;
}

header{
text-align:center;
margin-top:25px;
}

header h1{
margin:0;
font-size:28px;
font-weight:800;
}

header h2{
margin-top:8px;
font-weight:400;
}

.card{
background:#fff;
color:#000;
width:95%;
max-width:1000px;
border-radius:18px;
padding:25px;
margin-top:30px;
box-shadow:0 20px 40px rgba(0,0,0,.25);
text-align:center;
}

.card img{
width:100%;
height:auto;
object-fit:cover;
border-radius:14px;
border:3px solid #1e90ff;
background:#eee;
}

#txt{
margin-top:14px;
font-size:22px;
font-weight:700;
color:#0a3d62;
min-height:30px;
}

audio{
width:100%;
margin-top:15px;
}

footer{
margin-top:auto;
padding:15px;
opacity:.9;
}
</style>
</head>

const audio  = document.getElementById("player");
const img    = document.getElementById("img");
const txt    = document.getElementById("txt");

img.src = slides[0].src;
txt.textContent = slides[0].text;



audio.addEventListener("timeupdate", ()=>{

let t = audio.currentTime;

for(let s of slides){

      img.src = s.src;
      txt.textContent = s.text;
    }

    break;
  }
}

});
